import Login_page from './frontend/Login/Login_page'
import Signup from './frontend/Signup/Signup'
import React from 'react';
import './App.css'
import {
  createBrowserRouter,
  RouterProvider,
  Route,
} from "react-router-dom";

function App() {
  return (
    <>
      <Switch>
        <Route path="/Login">
          <Login_page/>
        </Route>
        <Route path="Signup">
        <Login_page/>
      <Signup/>
        </Route>
      </Switch>
    </>
  );
}

export default App;
